import React from 'react';
import Card from './Card';

const TrackerInfo = [
   {
      id: '1234',
      name: 'Task 1',
      start: '',
      end: ''
   },
   {
      id: '1235',
      name: 'Task 2',
      start: '',
      end: ''
   },
   {
      id: '1236',
      name: 'Task 3',
      start: '',
      end: ''
   },
   {
      id: '1237',
      name: 'Task 4',
      start: '',
      end: ''
   },
]

const Home = () => (
   <div className="container">
      <h1>Tracker Info</h1>
      <button className="btn btn-success">Create Card</button>
      <button className="btn btn-danger">Delete Card</button>
      {TrackerInfo.map( (info) => (
         <Card key={info.id} info={info}/>
      ))}
   </div>
)

export default Home;
